package com.xinyan.mms.materials.query;/** * 单位字典表 */public class QueryUnit_Dictionary {    private int unit_coding;    private String unit_name;    @Override    public String toString( ) {        return "QueryUnit_Dictionary{" +                "unit_coding=" + unit_coding +                ", unit_name='" + unit_name + '\'' +                '}';    }    public int getUnit_coding() {        return unit_coding;    }    public void setUnit_coding(int unit_coding) {        this.unit_coding = unit_coding;    }    public String getUnit_name() {        return unit_name;    }    public void setUnit_name(String unit_name) {        this.unit_name = unit_name;    }}